import path from "./path";
import { useSelector } from "react-redux";
const {dataUser, isLoading, isLogin} = useSelector(state => state.user)
const dataTopHeader = [
  {
    id: 1,
    value: "Trang chủ",
    path: path.HOME,
  },
  {
    id: 2,
    value: "Giới thiệu",
    path: path.INTRODUCTE,
  },
  {
    id: 3,
    value: "Sản phẩm",
    path: path.PRODUCTS,
  },
  {
    id: 4,
    value: "Tin tức",
    path: path.BLOGS,
  },
  {
    id: 5,
    value: "Dịch vụ",
    path: path.OURSERVICES,
  },
  {
    id: 6,
    value: isLogin ? `Xin chào` : "Đăng nhập",
    path: path.LOGIN,
  },
];

export default dataTopHeader;
